import React from "react";

export default function HomePage() {
  return (
    <div className="min-h-screen bg-gradient-to-br from-pink-50 to-yellow-50 flex flex-col items-center justify-center px-4">
      {/* Heading */}
      <h1 className="text-5xl md:text-6xl font-extrabold text-pink-700 text-center mb-4">
        Welcome to Shaila Bakes
      </h1>

      {/* Subheading */}
      <p className="text-lg md:text-xl text-gray-700 text-center max-w-xl mb-8">
        Delicious cakes and baked treats made with love and joy. We bring sweetness to your celebrations.
      </p>

      {/* Buttons */}
      <div className="flex gap-4 flex-wrap justify-center">
        <a
          href="/menu"
          className="bg-pink-600 text-white px-6 py-3 rounded-full hover:bg-pink-700 transition font-medium"
        >
          View Menu
        </a>
        <a
          href="/contact"
          className="bg-white border border-pink-600 text-pink-600 px-6 py-3 rounded-full hover:bg-pink-50 transition font-medium"
        >
          Contact Us
        </a>
      </div>
    </div>
  );
}
